import { Link, Outlet, NavLink } from "react-router-dom";

function Navbar() {
  return (
    <>
      <div className="nav">
          <NavLink style={({isActive})=>isActive?{color: "blue"}: "black"} to="/"><h4>HOME</h4></NavLink>
          <NavLink style={({isActive})=>isActive?{color: "blue"}: "black"} to="/about"><h4>HOME</h4></NavLink>
          <Link to="/about"><h4>ABOUT</h4></Link>
          <Link to="/items"><h4>ITEMS</h4></Link>

      </div>
      <Outlet/>
    </>
  );
}

export default Navbar;
